import { MongoClient } from 'mongodb';

const host = process.env.DB_HOST || 'localhost';
const port = process.env.DB_PORT || 27017;
const database = process.env.DB_DATABASE || 'files_manager';
const url = `mongodb://${host}:${port}/`;

class DBClient {
  constructor() {
    this.db = null;
    this.connectToDB();
  }

  // Ensures MongoDB connection is established
  async connectToDB() {
    try {
      const client = await MongoClient.connect(url, { useUnifiedTopology: true });
      this.db = client.db(database);
      console.log('Connected to MongoDB');

      // Ensure collections are created and populated with sample data
      await this.ensureCollections();
    } catch (error) {
      console.error('MongoDB connection failed:', error);
    }
  }

  // Ensures collections 'users' and 'files' exist and adds sample data
  async ensureCollections() {
    try {
      const collections = await this.db.listCollections().toArray();
      const collectionNames = collections.map((col) => col.name);

      console.log('Existing collections:', collectionNames);  // Debug log

      // Create 'users' collection if it doesn't exist
      if (!collectionNames.includes('users')) {
        await this.db.createCollection('users');
        console.log('Created "users" collection');
      }

      // Add sample data to 'users' collection if it's empty
      const usersCount = await this.db.collection('users').countDocuments();
      if (usersCount === 0) {
        const sampleUsers = [
          { name: 'User 1', email: 'user1@example.com' },
          { name: 'User 2', email: 'user2@example.com' },
          { name: 'User 3', email: 'user3@example.com' },
          { name: 'User 4', email: 'user4@example.com' }
        ];
        await this.db.collection('users').insertMany(sampleUsers);
        console.log('Inserted sample users into "users" collection');
      }

      // Create 'files' collection if it doesn't exist
      if (!collectionNames.includes('files')) {
        await this.db.createCollection('files');
        console.log('Created "files" collection');
      }

      // Add sample data to 'files' collection if it's empty
      const filesCount = await this.db.collection('files').countDocuments();
      if (filesCount === 0) {
        const sampleFiles = Array.from({ length: 30 }, (_, i) => ({
          filename: `file_${i + 1}.txt`,
          size: Math.floor(Math.random() * 1000)
        }));
        await this.db.collection('files').insertMany(sampleFiles);
        console.log('Inserted sample files into "files" collection');
      }

    } catch (err) {
      console.error('Failed to create collections or insert data', err);
    }
  }

  // Returns true if MongoDB client is connected
  isAlive() {
    return !!this.db;
  }

  // Returns number of documents in 'users' collection
  async nbUsers() {
    return this.db.collection('users').countDocuments();
  }

  // Returns the first user matching the query
  async getUser(query) {
    console.log('QUERY IN DB.JS', query);
    const user = await this.db.collection('users').findOne(query);
    console.log('GET USER IN DB.JS', user);
    return user;
  }

  // Returns number of documents in 'files' collection
  async nbFiles() {
    return this.db.collection('files').countDocuments();
  }

  // Inserts a new file into the 'files' collection
  async saveFile(fileData) {
    const result = await this.db.collection('files').insertOne(fileData);
    return { _id: result.insertedId, ...fileData };
  }
}

// Export DBClient instance
module.exports = new DBClient();

